import React from 'react';
import NavBarHeader from '../NavBarHeader/NavBarHeader';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './NavBar.css';
import AboutMeView from '../../views/Root/aboutMeView';
import ContactView from '../../views/Root/ContactView';
import PhotoGalleryView from '../../views/Root/PhotoGalleryView';
import { Link } from 'react-router-dom'

function NavBar() {
    return (
        <BrowserRouter >
            <div className='wrapper'>


                <NavBarHeader >
                    <Link to='/aboutMeView'>o cccccc</Link> 
                </NavBarHeader>


                <NavBarHeader >
                    <Link to='/PhotoGallery'>Galeria</Link>
                </NavBarHeader>

                <NavBarHeader >
                    <Link to='/PhotoGallery'>Galeria</Link>
                </NavBarHeader>

            <Link href='/About'>
                <NavBarHeader text='Kontakt'></NavBarHeader>
            </Link>
            <Switch>
            <Route path='/About' >
                <aboutMeView />
                </Route>
            <Route path='/Contact' component={ContactView}/>
            <Route path='/PhotoGallery' component={PhotoGalleryView} />
            </Switch>

            </div>
            </BrowserRouter>

    )
}

export default NavBar
